from Crypto.Cipher import AES
from Crypto.Util.Padding import pad
import os
from secret import FLAG

def keygen(keysize):
    key = os.urandom(2)
    while len(key) != keysize:
        key += bytes([(key[-2] + key[-1]) % 256])
    return key

def aesenc(key, msg):
    return AES.new(key, AES.MODE_ECB).encrypt(pad(msg, 16))

def encrypt(msg):
    for _ in range(50):
        key = keygen(16)
        msg = aesenc(key, msg)
    return msg

enc = encrypt(FLAG).hex()
print(f"{enc = }")

